
<!DOCTYPE html>
<meta charset="utf-8">
    <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css">
    <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Proxima+Nova">

<style>
	body{
	 background : #fff;
	}
	
	[class*="col-"]{
		padding: 0px;
		margin: 5px auto;
	}

	[class*="col-"] .row{
		margin-right: 0px;
		margin-left: 0px;
	}

	.box{
		//background: #fff;
		margin: 6px;
		padding: 5px 0;
		/*border: 1px solid #d4d4d4;*/
		border-top-color: rgb(204, 204, 204);
		border-top-style: solid;
		border-top-width: 1px;
		border-right-width: 1px;
		border-bottom-width: 1px;
		border-left-width: 1px;
		border-radius: 0 0 4px 4px;
		border-top-left-radius: 0px;
		border-top-right-radius: 0px;
		border-width: 0 0 3px;
		border-top-width: 0px;
		display:block;
		height:100%;
		overflow: hidden;
		animation-duration: 1s;
		animation-name: fadeAndScale;
		animation-timing-function: cubic-bezier(.71,.55,.62,1.57);
	}
	.row-margin {
		margin-top: -8px;
	}
	.title {
		font-size: 15px;
		//color: rgba(0,0,0,0.6);
		color: rgba(0,0,0,0.8);
		text-align: left;
		padding-left: 15px;
		font-weight:bold;
		margin-top:10px;
		padding-left: 10px !important;
	}
	.page-title {
		font-size: 18px;
		margin: 0 -10px;
		color: rgba(0,0,0,0.6);
		text-align: left;
	}
	.box .title {
		padding-left: 0px;
	}
	/* Ripple effect */
	.ripple {
		background-position: center;
		transition: background 0.8s;
	}
	.ripple:active {
		background: rgba(0,0,0,0.1) radial-gradient(circle, transparent 1%, rgba(0,0,0,0.1) 1%);
		background-size: 100%;
		transition: background 0s;
	}

	/* Animation effect */
	@keyframes fadeAndScale {
		from {
			opacity: 0;
			transform: scale(.9, .9);
		}
		to {
			opacity: 1;
			transform: scale(1, 1);
		}
	}
	.axis .tick text{
		font-size:8px;
		fill:#222;
	}
	.axis .tick line{
		stroke:#222;
	}
	.axis path{
		stroke:#222;
	}
	.tooltip{
		  position      : absolute;
		  text-align    : center;
		  padding       : 8px;
		  border        : none;
		  border-radius : 8px;
		  background    : rgb(0,0,0,.8);
		  color         : #fff;
		  pointer-events: none;
		  font-size		: 11px;
	  }

	.movingSum {
	  stroke: black;
	  stroke-width: 2px;
	  fill: none;
	}

	.lowArc {
	  fill: #fee0d2;
	}
	.middleArc {
	  fill: #fc9272;
	}
	.highArc {
	  fill: #de2d26;
	}

	.axisCircle{
	  fill: none;
	  stroke: lightgray;
	  stroke-width: 1;
	}

	.axisLabel{
	  font-family: sans-serif;
	  font-size: 0.75em;
	  fill: lightgray;

	}

	.monthLine{
	  stroke: lightgray;

	}

	.monthLabel{
	  font-family: sans-serif;
	  font-size: 1em;
	  fill: lightgray;

	}

	.yearLabel{
	  font-family: sans-serif;
	  font-size: 2.5em;
	  fill: black;
	}

	.summaryNumber{
	  font-family: sans-serif;
	  font-size: 1em;
	}

	.distance{
	  fill: #fc9272;
	}

	.distanceLine{
	  stroke-width: 1.5px;
	  stroke: yellow;
	}

	.elevation{
	  fill: #51aae8;
	}

	.elevationLine{
	  stroke-width: 1.5px;
	  stroke: #51aae8;
	}

	.selected{
	  stroke-width: 5px;
	  stroke: #624D9A;
	}
	.overlay {
      fill: none;
      pointer-events: all;
    }

    text {
      font-size: 10px;
      font-family: sans-serif;
    }

    .legend-text {
      font-size: 11px;
    }

</style>

2.447506,37.721585,0","Name":"Balboa Park (BALB)"},{"Abbreviation":"BAYF","Description":"15242 Hesperian Blvd., San Leandro CA 94578<br />Bay Fair Station provides easy access to Bayfair Center in San Leandro, one of the first shopping centers built in the East Bay.","Location":"-122.126514,37.696924,0","Name":"Bay Fair (BAYF)"},{"Abbreviation":"CAST","Description":"3301 Norbridge Dr., Castro Valley CA 94546<br />Once known for its chicken ranches, Castro Valley was named after Don Guillermo Castro, a local rancher and magistrate in the mid-1800s.","Location":"-122.075602,37.690746,0","Name":"Castro Valley (CAST)"},{"Abbreviation":"CIVC","Description":"1150 Market Street, San Francisco CA 94102<br />Civic Center/UN Plaza Station is nearby some notable San Francisco destinations including including City Hall, War Memorial Opera House, Asian Art Museum, Louise M. Davies Symphony Hall, and the Main Branch of the San Francisco Public Library.","Location":"-122.414123,37.779732,0","Name":"Civic Center/UN Plaza (CIVC)"},{"Abbreviation":"COLS","Description":"7200 San Leandro St., Oakland CA 94621<br />Welcome to Coliseum<br />Coliseum is the transfer Station that connects BART to the Oakland Int'l Airport Station (OAKL). The station is also connected by a pedestrian bridge to the O.co Coliseum and Oracle Arena.","Location":"-122.196869,37.753661,0","Name":"Coliseum/Oakland Airport (COLS)"},{"Abbreviation":"COLM","Description":"365 D Street, Colma CA 94014<br />The Town of Colma is a diverse community on the San Francisco peninsula that maintains that \"small town\" feel despite being so close to major cities. The Colma BART Station is close to residential neighborhoods and shopping areas. Colma is perhaps best known for its 17 cemeteries, which comprise approximately 73% of the town's land area. The town incorporated in 1924 primarily to protect this land use. Colma's cemeteries represent numerous religious beliefs and nationalities, and include structures and districts which are historically significant on local, state and national levels.","Location":"-122.466233,37.684638,0","Name":"Colma (COLM)"},{"Abbreviation":"CONC","Description":"1451 Oakland Avenue, Concord CA 94520<br />Concord is the largest city in Contra Costa County. The Concord BART Station was the \"end of the line\" until 1995 when the line was extended to Pittsburg/Bay Point.","Location":"-122.029095,37.973737,0","Name":"Concord (CONC)"},{"Abbreviation":"DALY","Description":"500 John Daly Blvd., Daly City CA 94014<br />Daly City, located at the northernmost edge of San Mateo County, is often called the \"Gateway to the Peninsula.\"","Location":"-122.469081,37.706121,0","Name":"Daly City (DALY)"},{"Abbreviation":"DBRK","Description":"2160 Shattuck Avenue, Berkeley CA 94704<br />The Downtown Berkeley BART Station is located on Shattuck Avenue between Allston Way and Addison Street. It is conveniently located close to the University of California campus and to many shops, restaurants, theaters and other attractions, and has valet bike parking.","Location":"-122.268133,37.870104,0","Name":"Downtown Berkeley (DBRK)"},{"Abbreviation":"DELN","Description":"6400 Cutting Blvd., El Cerrito CA 94530<br />Sometimes called simply \"del Norte,\" as the name suggests this station serves the northern part of the City of El Cerrito.","Location":"-122.316794,37.925086,0","Name":"El Cerrito del Norte (DELN)"},{"Abbreviation":"DUBL","Description":"5801 Owens Dr., Pleasanton CA 94588<br />This unique station straddles the border of Dublin and Pleasanton on Interstate 580. The station features a number of local and regional bus connections.","Location":"-121.899179,37.701687,0","Name":"Dublin/Pleasanton (DUBL)"},{"Abbreviation":"EMBR","Description":"298 Market Street, San Francisco CA 94111<br />Located in San Francisco's Financial District at the foot of Market Street, Embarcadero Station is close to the Ferry Building, Embarcadero Center, Transbay Terminal and the California Street cable car.","Location":"-122.397020,37.792874,0","Name":"Embarcadero (EMBR)"},{"Abbreviation":"FRMT","Description":"2000 BART Way, Fremont CA 94536<br />Fremont Station is an important regional transfer point for service to AC Transit and Santa Clara Transportation Authority (VTA). The city, and the station, are named for American explorer John Charles Frmont.","Location":"-121.976608,37.557465,0","Name":"Fremont (FRMT)"},{"Abbreviation":"FTVL","Description":"3401 East 12th Street, Oakland CA 94601<br />Originally called \"Fruit Vale,\" the neighborhood around Fruitvale BART Station was mostly apricot and cherry orchards in the late 1800s. Today, it's a vibrant neighborhood and one of Oakland's main commercial areas.","Location":"-122.224175,37.774836,0","Name":"Fruitvale (FTVL)"},{"Abbreviation":"GLEN","Description":"2901 Diamond Street, San Francisco CA 94131<br />The Glen Park neighborhood in San Francisco is nestled in a small valley below Diamond Heights, and BART is at the center of the neighborhood on the corner of Diamond and Bosworth Streets.","Location":"-122.433817,37.733064,0","Name":"Glen Park (GLEN)"},{"Abbreviation":"HAYW","Description":"699 'B' Street, Hayward CA 94541<br />The City of Hayward is known as the \"Heart of the Bay\" for its central and convenient location in Alameda County. Hayward BART Station is near a pedestrian-friendly downtown with a mix of housing, shops, offices and restaurants.","Location":"-122.087018,37.669723,0","Name":"Hayward (HAYW)"},{"Abbreviation":"LAFY","Description":"3601 Deer Hill Road, Lafayette CA 94549<br />Centrally located in the East Bay hills, Lafayette exudes a quiet rural atmosphere and features a distinctive downtown.","Location":"-122.124630,37.893176,0","Name":"Lafayette (LAFY)"},{"Abbreviation":"LAKE","Description":"800 Madison Street, Oakland CA 94607<br />Lake Merritt Station is ideally located near near Oakland Chinatown, Laney College and the Oakland Museum.","Location":"-122.265180,37.797027,0","Name":"Lake Merritt (LAKE)"},{"Abbreviation":"MCAR","Description":"555 40th Street, Oakland CA 94609<br />MacArthur Station is a major BART transfer point near the commercial heart of Temescal, one of north Oakland's oldest neighborhoods.","Location":"-122.267040,37.829065,0","Name":"MacArthur (MCAR)"},{"Abbreviation":"MLBR","Description":"200 North Rollins Road, Millbrae CA 94030<br />Situated on an estate formerly owned by Darius Ogden Mills, this city's name derives from \"Mills\" and the Scottish word \"brae\" or \"rolling hills.\" Today, the Millbrae BART station is the largest intermodal terminal west of the Mississippi, featuring a cross-platform connection to Caltrain.","Location":"-122.386702,37.600271,0","Name":"Millbrae (MLBR)"},{"Abbreviation":"MONT","Description":"598 Market Street, San Francisco CA 94104<br />Located in the heart of San Francisco's Financial District on Market Street, Montgomery Station features excellent access to San Francisco Muni and destinations throughout the city.","Location":"-122.401066,37.789405,0","Name":"Montgomery St. (MONT)"},{"Abbreviation":"NBRK","Description":"1750 Sacramento Street, Berkeley CA 94702<br />North Berkeley Station features a unique circular building and offers easy access to the Ohlone Greenway, an East Bay pedestrian and bicycle path.","Location":"-122.283440,37.873967,0","Name":"North Berkeley (NBRK)"},{"Abbreviation":"NCON","Description":"3700 Port Chicago Highway, Concord CA 94520<br />The North Concord/Martinez station opened December 16, 1995 and briefly served as \"end of the line\" until BART completed the Pittsburg/Bay Point extension over Willow Pass in 1996.","Location":"-122.024653,38.003193,0","Name":"North Concord/Martinez (NCON)"},{"Abbreviation":"OAKL","Description":"1 Airport Drive, Oakland CA 94621<br />Located at the Oakland International Airport, the Oakland Airport station has frequent service to the Coliseum station.","Location":"-122.212191,37.713238,0","Name":"Oakland Airport (OAKL)"},{"Abbreviation":"ORIN","Description":"11 Camino Pablo, Orinda CA 94563<br />Originally a rural area known for ranching and summer cabins, today Orinda is primarily a residential community with a rich history that is depicted on a mural and map in the station.","Location":"-122.183791,37.878361,0","Name":"Orinda (ORIN)"},{"Abbreviation":"PHIL","Description":"1365 Treat Blvd., Walnut Creek CA 94597<br />BART, buses, Highway 680 and the Iron Horse pedestrian and bicycle trail all converge to make this one of BART's most easily accessed stations.","Location":"-122.056012,37.928468,0","Name":"Pleasant Hill/Contra Costa Centre (PHIL)"},{"Abbreviation":"PITT","Description":"1700 West Leland Road, Pittsburg CA 94565<br />Pittsburg/Bay Point is a terminal station on the yellow line serving northern and eastern Contra Costa County.","Location":"-121.945154,38.018914,0","Name":"Pittsburg/Bay Point (PITT)"},{"Abbreviation":"PLZA","Description":"6699 Fairmount Avenue, El Cerrito CA 94530<br />El Cerrito Plaza is one of two BART stations in the City of El Cerrito. It serves southern El Cerrito, northern Albany, Kensington and nearby areas of Berkeley and Richmond.","Location":"-122.298904,37.902632,0","Name":"El Cerrito Plaza (PLZA)"},{"Abbreviation":"POWL","Description":"899 Market Street, San Francisco CA 94102<br />Located at Powell and Market Streets, this station is centrally located near San Francisco's most popular attractions including the cable cars, Union Square, Yerba Buena Gardens, the Moscone Convention Center and the City's Theatre District.","Location":"-122.407974,37.784471,0","Name":"Powell St. (POWL)"},{"Abbreviation":"RICH","Description":"1700 Nevin Avenue, Richmond CA 94801<br />Three major railroad tracks, including BART's, help to outline the \"Iron Triangle\" in Richmond: a largely residential area that also includes the downtown Richmond business district along Macdonald Avenue.","Location":"-122.353099,37.936853,0","Name":"Richmond (RICH)"},{"Abbreviation":"ROCK","Description":"5660 College Avenue, Oakland CA 94618<br />Named for local rock outcroppings formed by the Hayward Fault, the Rockridge neighborhood is a vibrant residential neighborhood, retail and commercial district in Oakland.","Location":"-122.251371,37.844702,0","Name":"Rockridge (ROCK)"},{"Abbreviation":"SANL","Description":"1401 San Leandro Blvd., San Leandro CA 94577<br />Agriculture was an important part of San Leandro's history and cherries were one of the City's most well-known crops. The city's first Cherry Festival was held in 1909 and the tradition still continues today.","Location":"-122.160844,37.721947,0","Name":"San Leandro (SANL)"},{"Abbreviation":"SBRN","Description":"1151 Huntington Avenue, San Bruno CA 94066<br />San Bruno Station is next to the city's Tanforan shopping mall and business area. Before becoming a mall, Tanforan was a racetrack, airfield, military center and, during World War II, a Japanese American internment center.","Location":"-122.416287,37.637761,0","Name":"San Bruno (SBRN)"},{"Abbreviation":"SFIA","Description":"International Terminal, Level 3, San Francisco Int'l Airport CA 94128<br />This station is located in the International Terminal at SFO. It's a short walk to United Airlines in Terminal 3, but all domestic terminals (1, 2 &amp; 3) are one to three minutes away on AirTrain.","Location":"-122.392409,37.615966,0","Name":"San Francisco Int'l Airport (SFIA)"},{"Abbreviation":"SHAY","Description":"28601 Dixon Street, Hayward CA 94544<br />Hayward, originally known as 'Haywards', is named for William Hayward, a New England shoe factory worker who came to California during the Gold Rush.","Location":"-122.057189,37.634375,0","Name":"South Hayward (SHAY)"},{"Abbreviation":"SSAN","Description":"1333 Mission Road, South San Francisco CA 94080<br />Emerging from a portion of old Rancho Buri Buri, South San Francisco occupies the basin and portions of the sides of a broad valley formed by the San Bruno Mountains on the north and the Coast Range on the west.","Location":"-122.443960,37.664245,0","Name":"South San Francisco (SSAN)"},{"Abbreviation":"UCTY","Description":"10 Union Square, Union City CA 94587<br />Incorporated in 1959, Union City combined the communities of Alvarado, Decoto, and New Haven. Alvarado was the original county seat of Alameda County, and the site of the first county courthouse is a California Historical Landmark.","Location":"-122.017388,37.590630,0","Name":"Union City (UCTY)"},{"Abbreviation":"WARM","Description":"45193 Warm Springs Blvd, Fremont, CA 94539<br />Warm Springs/South Fremont Station is currently the most southern station and is the first station to open on the new San Jose extension.","Location":"-121.939313,37.502171,0","Name":"Warm Springs/South Fremont (WARM)"},{"Abbreviation":"WCRK","Description":"200 Ygnacio Valley Road, Walnut Creek CA 94596<br />The Walnut Creek BART Station is a key piece of infrastructure for a thriving community that can also be characterized as the business and arts center for Contra Costa County.","Location":"-122.067527,37.905522,0","Name":"Walnut Creek (WCRK)"},{"Abbreviation":"WDUB","Description":"6501 Golden Gate Drive, Dublin CA 94568<br />This station straddles the border of Dublin and Pleasanton on Interstate 580 and is near the Stoneridge Shopping Center. It is BART's 44th station.","Location":"-121.928240,37.699756,0","Name":"West Dublin/Pleasanton (WDUB)"},{"Abbreviation":"WOAK","Description":"1451 7th Street, Oakland CA 94607<br />The West Oakland BART Station is located in the West Oakland residential and industrial community. The station serves both local residents and riders from throughout the region with its excellent freeway access and short ride to downtown San Francisco.","Location":"-122.295140,37.804872,0","Name":"West Oakland (WOAK)"}];
